import React, { Component } from 'react';
import axios from 'axios'

class Main extends Component {
    state = { 
        users: []
     }

     componentDidMount() {
         axios.get('https://jsonplaceholder.typicode.com/users')
         .then(response => {
             console.log(response)
             this.setState({
                 users: response.data[4]
             })
         })
         .catch(error => {
             console.log(error)
         })
     }

    render() { 

        let { users } = this.state
        return ( 
            <div>
                <p>Name: {users.name}</p>
                <p>{users.city}</p>
            </div>
         );
    }
}

export default Main;
